<!DOCTYPE html>
<!--HTML Start-->
<html lang="$LANG" prefix="og: http://ogp.me/ns#">

      content="minimum-scale=1, initial-scale=1, width=device-width, shrink-to-fit=no, user-scalable=no, viewport-fit=cover"
    />

    <meta name="keywords" content="$KEYWORDS" />

      property="og:description"
      content="$DESCRIPTION"
    />
    <meta name="og:type" property="og:type" content="website" />

    <meta name="og:image" property="og:image" content="$PUBLIC_URL/img/.png" />
    <meta name="og:locale" property="og:locale" content="en-GB" />
    <meta name="application-name" content="$TITLE" />
    <meta name="mobile-web-app-capable" content="yes" />

    <meta name="msapplication-tap-highlight" content="no" />

      href="//fonts.googleapis.com/css?family=Roboto:300,400,500,700&display=swap"
      as="style"
      crossorigin="anonymous"
    />

    <!-- CSS Imports Start -->

    />
    <link
      rel="icon dns-prefetch"
      type="image/png"
      sizes="16x16"
      href="/img/favicon-16x16.png"
    />
    <link rel="apple-touch-icon dns-prefetch" href="/img/" />
    <link rel="manifest dns-prefetch" href="/manifest.json" />
    <!-- Prefetching End -->
  </head>
  <!-- Head End -->
